ine("text!components/autocomplete.html",["module"],function(n){n.exports='<template>\n\n    <section>\n        <h1>mdc-autocomplete</h1>\n\n        <mdc-autocomplete lookup.call="onChangeLookupEvent(newValue, oldValue)" select.call="onSelectionEvent(item)" items.bind="filteredList">\n\n            <input type="text" class="mdc-text-field__input" value.bind="selectedCountry.name">\n            <label class="mdc-text-field__label">Select a country</label>\n\n            <template replace-part="item-template">\n                <span class="mdc-list-item__text">${item.name}\n                    <span class="mdc-list-item__text__secondary">${item.code}</span>\n                </span>\n            </template>\n\n        </mdc-autocomplete>\n\n    </section>\n\n\n    <section>\n\n        <code-tabs>\n            <template replace-part="tab-view-template">\n                <au-code language="html">\n                    <mdc-autocomplete lookup.call="onChangeLookupEvent(newValue, oldValue)" select.call="onSelectionEvent(item)" items.bind="filteredList">\n\n                        <input type="text" class="mdc-text-field__input" value.bind="selectedCountry.name">\n                        <label class="mdc-text-field__label">Select a country</label>\n\n                        <template replace-part="item-template">\n                            <span class="mdc-list-item__text">${item.name}\n                                <span class="mdc-list-item__text__secondary">${item.code}</span>\n                            </span>\n                        </template>\n\n                    </mdc-autocomplete>\n                </au-code>\n            </template>\n            <template replace-part="tab-model-template">\n                <au-code language="javascript">\n                    import { bindable, bindingMode } from \'aurelia-framework\';\n\n                    import countriesJSON from \'text!../countries.json\';\n                    const countries = JSON.parse(countriesJSON);\n                    Object.freeze(countries);\n\n\n                    export class Autocomplete {\n                        @bindable({ defaultBindingMode: bindingMode.oneWay }) filteredList;\n\n                        constructor() {\n                            this.selectedCountry = {\n                                id: "",\n                                description: ""\n                            }\n                        }\n\n                        async onChangeLookupEvent(newValue, oldValue) {\n                            this.filteredList = await new Promise((resolve, reject) => {\n                                resolve(countries.filter(ele => {\n                                    return (ele.code.toLowerCase().includes(newValue.toLowerCase()) || ele.name.toLowerCase().includes(newValue.toLowerCase()));\n                                }));\n                            });\n                        }\n\n                        async onSelectionEvent(item) {\n                            this.selectedCountry = item;\n                        }\n\n                    }\n                </au-code>\n            </template>\n        </code-tabs>\n\n    </section>\n\n</template>\n'}),define("text!resources/elements/code-tabs.css",["module"],function(n){n.exports=".code-tab-panel {\r\n    display: none;\r\n}\r\n\r\n.code-tab-panel.is-active {\r\n    display: block;\r\n}\r\n"}),define("text!components/chip.html",["module"],function(n){n.exports='<template>\n\n    <section>\n        <h1>mdc-chip</h1>\n\n        <mdc-chip remove.call="removeMe()" raised="true">\n            <div class="mdc-chip-icon">A</div>\n            <span>This is my chip</span>\n        </mdc-chip>\n\n    </section>\n\n\n\n    <section>\n\n        <code-tabs>\n            <template replace-part="tab-view-template">\n                <au-code language="html">\n                    <mdc-chip remove.call="removeMe()" raised="true">\n                        <div class="mdc-chip-icon">A</div>\n                        <span>This is my chip</span>\n                    </mdc-chip>\n                </au-code>\n            </template>\n        </code-tabs>\n\n    </section>\n\n</template>\n'}),define("text!components/datepicker.html",["module"],function(n){n.exports='<template>\n\n    <section>\n        <h1>mdc-datepicker</h1>\n\n        <mdc-datepicker locale.bind="locale" start-week-on="monday" value.bind="today">\n            <label class="mdc-text-field__label">Date</label>\n        </mdc-datepicker>\n    </section>\n\n\n    <section>\n\n        <code-tabs>\n            <template replace-part="tab-view-template">\n                <au-code language="html">\n                    <mdc-datepicker locale.bind="locale" start-week-on="monday" value.bind="today">\n                        <label class="mdc-text-field__label">Date</label>\n                    </mdc-datepicker>\n                </au-code>\n            </template>\n            <template replace-part="tab-model-template">\n                <au-code language="javascript">\n                    export class Datepicker {\n                        locale = \'de\';\n                        today = new Date();\n                    }\n                </au-code>\n            </template>\n        </code-tabs>\n\n    </section>\n\n</template>\n'}),define("text!components/index.html",["module"],function(n){n.exports="<template>\n    <router-view></router-view>\n</template>\n"}),define("text!components/overview.html",["module"],function(n){n.exports="<template>\n    <section>\n        <h1>Components</h1>\n    </section>\n</template>\n"}),define("text!components/tab-bar.html",["module"],function(n){n.exports='<template>\n\n    <require from="./tab-bar.css"></require>\n\n    <div>\n        <nav ref="demoTabBar" class="mdc-tab-bar" role="tablist">\n            <a role="tab" aria-controls="tab-1" class="mdc-tab mdc-tab--active">Tab 1</a>\n            <a role="tab" aria-controls="tab-2" class="mdc-tab">Tab 2</a>\n            <span class="mdc-tab-bar__indicator"></span>\n        </nav>\n    </div>\n\n    <section>\n        <div ref="demoPanels" class="tab-panels">\n            <div class="tab-panel is-active" id="tab-1" role="tabpanel" aria-hidden="false">\n                <p>content of tab 1</p>\n            </div>\n            <div class="tab-panel" id="tab-2" role="tabpanel" aria-hidden="true">\n                <p>content of tab 2</p>\n            </div>\n        </div>\n    </section>\n\n\n    <section>\n\n        <code-tabs>\n            <template replace-part="tab-view-template">\n                <au-code language="html">\n                    <require from="./tab-bar.css"></require>\n                    <div>\n                        <nav ref="myTabBar" class="mdc-tab-bar" role="tablist">\n                            <a role="tab" aria-controls="tab-1" class="mdc-tab mdc-tab--active">Tab 1</a>\n                            <a role="tab" aria-controls="tab-2" class="mdc-tab">Tab 2</a>\n                            <span class="mdc-tab-bar__indicator"></span>\n                        </nav>\n                    </div>\n\n                    <section>\n                        <div ref="panels" class="tab-panels">\n                            <div class="tab-panel is-active" id="tab-1" role="tabpanel" aria-hidden="false">\n                                <p>content of tab 1</p>\n                            </div>\n                            <div class="tab-panel" id="tab-2" role="tabpanel" aria-hidden="true">\n                                <p>content of tab 2</p>\n                            </div>\n                        </div>\n                    </section>\n                </au-code>\n            </template>\n            <template replace-part="tab-model-template">\n                <au-code language="javascript">\n                    export class TabBar {\n\n                        attached() {\n                            this.myTabBar.MDCTabBar.tabs.forEach((tab) => {\n                                tab.preventDefaultOnClick = true;\n                            });\n\n                            this.myTabBar.MDCTabBar.listen(\'MDCTabBar:change\', ({ detail: tabs }) => {\n                                this.updateTab(tabs.activeTabIndex);\n                            });\n                        }\n\n                        updateTab(idx) {\n                            let activePanel = this.panels.querySelector(".tab-panel.is-active");\n                            if (activePanel) {\n                                activePanel.classList.remove("is-active");\n                            }\n                            var newActivePanel = this.panels.querySelector(\n                                ".tab-panel:nth-child(" + (idx + 1) + ")"\n                            );\n                            if (newActivePanel) {\n                                newActivePanel.classList.add("is-active");\n                            }\n                        }\n                    }\n                </au-code>\n            </template>\n            <template replace-part="tab-style-template">\n                <au-code language="css">\n                    .tab-panel {\n                        display: none;\n                    }\n\n                    .tab-panel.is-active {\n                        display: block;\n                    }\n                </au-code>\n            </template>\n        </code-tabs>\n\n    </section>\n\n\n\n</template>\n'}),define("text!components/timepicker.html",["module"],function(n){n.exports='<template>\n    <section>\n        <h1>mdc-timepicker</h1>\n\n        <mdc-timepicker locale.bind="locale" value.bind="today">\n            <label class="mdc-text-field__label">Time</label>\n        </mdc-timepicker>\n    </section>\n\n\n    <section>\n\n        <code-tabs>\n            <template replace-part="tab-view-template">\n                <au-code language="html">\n                    <mdc-timepicker locale.bind="locale" value.bind="today">\n                        <label class="mdc-text-field__label">Time</label>\n                    </mdc-timepicker>\n                </au-code>\n            </template>\n            <template replace-part="tab-model-template">\n                <au-code language="javascript">\n                    export class Timepicker {\n                        locale = \'de\';\n                        today = new Date();\n                    }\n                </au-code>\n            </template>\n        </code-tabs>\n\n    </section>\n\n\n</template>\n'}),define("text!resources/elements/code-tabs.html",["module"],function(n){n.exports='<template>\n\n    <require from="./code-tabs.css"></require>\n\n    <div class="">\n        <nav ref="codeTabBar" class="mdc-tab-bar" role="tablist">\n            <a role="tab" aria-controls="code-tab-view" class="mdc-tab mdc-tab--active">View</a>\n            <a role="tab" aria-controls="code-tab-model" class="mdc-tab">Model</a>\n            <a role="tab" aria-controls="code-tab-style" class="mdc-tab">CSS</a>\n            <span class="mdc-tab-bar__indicator"></span>\n        </nav>\n    </div>\n\n    <section>\n        <div ref="codePanels" class="code-tab-panels">\n            <div class="code-tab-panel is-active" id="code-tab-view" role="tabpanel" aria-hidden="false">\n                <template replaceable part="tab-view-template"></template>\n            </div>\n            <div class="code-tab-panel" id="code-tab-model" role="tabpanel" aria-hidden="true">\n                <template replaceable part="tab-model-template"></template>\n            </div>\n            <div class="code-tab-panel" id="code-tab-style" role="tabpanel" aria-hidden="true">\n                <template replaceable part="tab-style-template"></template>\n            </div>\n        </div>\n    </section>\n\n</template>\n'});